import { SELECT_TAB } from '../actions/action-types';

const searchIcon = {
  scale: 2.3,
  uri: 'data:image/png;base64,'
};

const documentIcon = {
  scale: 2.3,
  uri: 'data:image/png;base64,'
};

const personIcon = {
  scale: 2.3,
  uri: 'data:image/png;base64,'
};

const initialState = {
  index: 2,
  tabs: [
    { key: 'search',  icon: searchIcon,   title: 'Search'     },
    { key: 'manage',  icon: documentIcon, title: 'Manage'     },
    { key: 'find-me', icon: personIcon,   title: 'Where am I?' }
  ]
};

export default ( state = initialState, action ) => {
  switch( action.type ) {
    case SELECT_TAB:
      if( action.index !== state.index ) {
        return {
          ...state,
          index: action.index
        };
      }
  }
  return state;
};